package break_contine;

public class Continue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
			int i=1;
			System.out.println("Out side for");
			for(i=1;i<10;i++)
			{
		
				if(i==5)
				{
					continue;
				}
				System.out.println(i);
			}
			

		}

	}


